var AbstractAPRSMessage = require('./AbstractAPRSMessage.js');

function ObjectReport() {
	this.name = '';
	this.indicator = '';
	
	this.timestamp = null;
	this.latitiude = null;
	this.longitude = null;
	
	this.symbolTableId = null;
	this.symbolCode = null;
	
	this.course = 0;
	this.speed = 0;
	this.direction = 0;
	
	this.radioRange = 0;
	this.dfSignalStrength = 0;
	this.areaObject = null;
	
	this.position = null;
	this.height = null;
	this.gain = null;
	
	this.comment = '';
	
	AbstractAPRSMessage.apply(this, arguments);
}

ObjectReport.prototype = new AbstractAPRSMessage();
ObjectReport.prototype.constructor = ObjectReport;

module.exports = ObjectReport;